package com.fc.brms.common.domain;import java.io.Serializable;import java.util.Date;public class UserTrackRecordContent implements Serializable {	private static final long serialVersionUID = 1L;	private int contentId;	private int trackId;	private int contentType;	private String content;	public void setContentId(int contentId) {		this.contentId = contentId;	}	public int getContentId() {		return this.contentId;	}	public void setTrackId(int trackId) {		this.trackId = trackId;	}	public int getTrackId() {		return this.trackId;	}	public void setContentType(int contentType) {		this.contentType = contentType;	}	public int getContentType() {		return this.contentType;	}	public void setContent(String content) {		this.content = content;	}	public String getContent() {		return this.content;	}}